import React from 'react';


type TodolistType = {
    task:TaskType[]
}

type TaskType= {
    id:string;
    title:string;
    isDone:boolean
}






export  const Todolist:React.FC<TodolistType> = ({task,...props}) => {


    return (
        <div>
           <ul>{task.map((el)=>{
               return( <li>
                   {el.title}
                   <input type={"checkbox"} checked={el.isDone}/>
               </li>)
               })

           }

           </ul>
        </div>
    );
};
